add_filter( 'pt-ocdi/disable_pt_branding', '__return_true' );

function ocdi_plugin_intro_text( $default_text ) {
    $default_text .= '<div class="ocdi__intro-text">Please be patient.</div>';

    return $default_text;
}
add_filter( 'pt-ocdi/plugin_intro_text', 'ocdi_plugin_intro_text' );



function ocdi_before_content_import( $selected_import ) {
	
	// Assign menus to their locations.
	$default_menu = get_term_by( 'name', 'Default Menu', 'nav_menu' );

	set_theme_mod( 'nav_menu_locations', array(
			'default' => $default_menu->term_id,
		)
	);


	
}
add_action( 'pt-ocdi/before_content_import', 'ocdi_before_content_import' );


function ocdi_after_import( $selected_import ) {
	
	$demo_name = $selected_import['import_file_name'];
	
	global $demo_names_array, $demo_wp_options_wpgmza_google_maps_api_key, $demo_wp_options_options;
	global $demo_wp_options_optionsframework, $demo_wp_options_page_for_posts;
	
    $demo_key = "myriad01";
	
	foreach ($demo_names_array as $name => $value){
		if ($value == $demo_name) $demo_key = $name;
	}
	
	update_option( 'optionsframework', unserialize('a:1:{s:2:"id";s:8:"myriadwp";}') );

	update_option( 'myriadwp', unserialize($demo_wp_options_options[$demo_key]) );
	
	$front_page_id = get_page_by_title( 'Home' );
	update_option( 'page_on_front', $front_page_id->ID );

    update_option( 'show_on_front', 'page' );
		
	update_option( 'wpgmza_google_maps_api_key', $demo_wp_options_wpgmza_google_maps_api_key[$demo_key] );
	
	// Assign menus to their locations.
	$default_menu = get_term_by( 'name', 'Default Menu', 'nav_menu' );

	set_theme_mod( 'nav_menu_locations', array(
			'default' => $default_menu->term_id,
		)
	);
	
	
}
add_action( 'pt-ocdi/after_import', 'ocdi_after_import' );

